import React, { useContext } from 'react';
import { Row, Col, Card } from 'antd';
import CoronaContext from '../context/index';
const GlobalVirus = () => {
	// context: hook of context api
	const context = useContext(CoronaContext);
	// console.log(context);
	return (
		<Row>
			<Col span={8}>
				<Card title={'Nhiem benh'}>
					<p>-Moi nhiem:1111</p>
					<p>-Tong ca nhiem: 1111 </p>
				</Card>
			</Col>
			<Col span={8}>
				<Card title={'Tu vong'}>
					<p>-Moi tu vong: 2222 </p>
					<p>-Tong ca tu vong: 2222</p>
				</Card>
			</Col>
			<Col span={8}>
				<Card title={'Tong so ca khoi benh'}>
					<p>-Moi khoi benh: 3333 </p>
					<p>-Tong ca khoi benh: 333</p>
				</Card>
			</Col>
		</Row>
	);
};
export default React.memo(GlobalVirus);
